(Fanamarihana: lahatsoratra nivoaka tamin'ny Febroary 2007)
LaFlammeTV nandefa ity lahatsary momba ny Fetin'ny Vahoaka ity tao amin'ny DailyMotion, hetsika iray nitranga tao Cotonou, Benin , narahany filazàna hoe :
Fety iray goavana ara-kolontsaina maka ny maha-izy azy avy any anatin'ireo fahasamihafàna ara-kolontsaina samihafan'ireo fombandrazana sy kolontsaina ao Benin ny Fetin'ny Vahoaka.
Mampiseho mivantana ny :
· TSODRANON'NY FANJAKANA ao TADO;
· ireo dihy mampiavaka manokana ny ao an-Dapa :
– « HOUNGAN » an'i Houawé ;
– « HOUNGAN » an'i Djimè (Allada) ;
· ireo fiavahana manokana ara-mozika sy dihy mirindra ahafantarana ny sasantsasany amin'ireo olompirenena sy Faritra ao Benin.
The Peoples’ Celebration is a gigantic cultural event that is rooted in the many traditions and cultures of Benin.
It features, live:
– A blessing of the Kingdom of Tado;
– “Houngan” of Houawe;
– “Houngan” of Djime;
– musical and choreographic specialties of certain nationalities and regions of Benin.
Ny Shinoa sy ny Japoney ary ny Koreana tsy mifampikasoka izany rehefa mifampiarahaba... dia izay...
Misaotra betsaka ny mpanoratra sy ny mpandika. Propagandy sa fiatsarambelatsihy sa eso no hilazana izao. Ianao firenena...
Mila manao fikarohana kely angamba raha tsy voasoratra ao amin'ny lahatsoratra ilay izy. Efa karazana...
